import  {Nav}  from '../Componets/Navbar/Nav'
import { Footer } from '../Componets/Footer/Footer'
import { Cervices } from '../Componets/Services/Cervices'
import { Web1 } from '../Componets/Web/Web1'

export const Web = () => {
    return (
        <div><Nav></Nav>
        <Cervices></Cervices>
        <Web1></Web1>
        <Footer></Footer></div>
      )
    }
